const HowBusyThisDay = props => {
  const taskscContext = useContext(TasksContext);

  let taskIcon = null;
  let iconNum = 0;
  if (props.type == 'Saturday' || props.type == 'Sunday') {
    taskIcon = <i class="fas fa-hourglass-start" />;
  } else {
    taskIcon = <i class="fas fa-business-time"></i>;
  }
};

